import React from "react";

import { Route, Routes } from "react-router-dom";
import UsersComponent from "./users";

function App() {


  return (
    <div className="App">
    <Routes>
      <Route path='/users' element={<UsersComponent/>}/>
    </Routes>


    </div>
  );
}

export default App;
